const CESIUMTOKEN = 'your token';

let viewer = new Cesium.Viewer('cesiumContainer',{
    animation: false,
    baseLayerPicker: false,
    fullscreenButton: false,
    vrButton: false,
    geocoder: true,
    skyAtmosphere:false,
    homeButton: true,
    sceneModePicker: true,
    timeline: false,
    navigationHelpButton: false,
    navigationInstructionsInitiallyVisible: false,
    scene3DOnly: false,
    sceneMode: Cesium.SceneMode.SCENE3D,
    orderIndependentTranslucency:false,
    imageryProvider:new Cesium.ArcGisMapServerImageryProvider({
        url: "http://map.geoq.cn/arcgis/rest/services/ChinaOnlineStreetPurplishBlue/MapServer"
    })
});

viewer.scene.fxaa = true;
viewer.scene.postProcessStages.fxaa.enabled = true;

//以下 为 自动闪烁炫酷特效 cesium1.87以上新增
let uniforms = {
    u_texture: {
        value: new Cesium.TextureUniform({
            url: './building.png'
        }),
        type: Cesium.UniformType.SAMPLER_2D
    },
    T_time: {
        value: 0,
        type: Cesium.UniformType.FLOAT
    }
}
const createBuildingShader = () => {
    return new Cesium.CustomShader({
        lightingModel: Cesium.LightingModel.UNLIT,
        varyings: {
            v_normalMC: Cesium.VaryingType.VEC3
        },
        uniforms: uniforms,
        vertexShaderText: /* glsl */ `
          void vertexMain(VertexInput vsInput, inout czm_modelVertexOutput vsOutput) {
            v_normalMC = vsInput.attributes.normalMC;
          }`,
        fragmentShaderText: /* glsl */ `
          void fragmentMain(FragmentInput fsInput, inout czm_modelMaterial material) {
            vec3 positionMC = fsInput.attributes.positionMC;
            
            
            float width = 300.0;
            float height = 300.0;
            if (v_normalMC.z > 0.95) {
              material.diffuse = vec3(0.079, 0.107, 0.111);
              return;
            } else {
              float textureX =mod(200.0, width) / width;
              float textureY = mod(positionMC.z, height) / height;
              vec3 rgb = texture2D(u_texture, vec2(textureX, textureY-T_time)).rgb;
              gl_FragColor = vec4(0.2,  0.5, 1.0, 1.0);
              gl_FragColor *= vec4(vec3((positionMC.z + 40.0) / 30.0,0.3,0.8), 1.0);
              rgb = mix(gl_FragColor.rgb,rgb,0.5);
              material.diffuse = rgb;
              return;
            }
          }`
    })
}

let tileset = viewer.scene.primitives.add(
    new Cesium.Cesium3DTileset({
        customShader: createBuildingShader(),
        showOutline: false,
        enableModelExperimental: true,
        url:'http://localhost/gl/716/tileset.json'
    })
)

tileset.style=new Cesium.Cesium3DTileStyle({
    color:{
        conditions:[
            ['true', "color('cyan')"]
        ]
    }
});

render()

function render() {
    requestAnimationFrame(render)
    uniforms.T_time.value += 0.005
}
//以上 自动闪烁炫酷特效 cesium1.87以上新增

let minR=1;//最小半径
let maxR = 800;// 最大半径
let deviationR = 1; // 每次增加的大小
function changeR1() {
    minR=minR+deviationR;//deviationR为每次圆增加的大小
    if(minR>=800){
        minR=1;
    }
    return minR;
}
function color() {
    let x=1-minR/maxR;
    return Cesium.Color.WHITE.withAlpha(x);
}


let entitys = viewer.entities.add({
    position: Cesium.Cartesian3.fromDegrees(119.60964,34.56568),
    name: 'Red ellipse on surface with outline',
    ellipse: {
        semiMinorAxis: new Cesium.CallbackProperty(changeR1,false),
        semiMajorAxis: new Cesium.CallbackProperty(changeR1,false),
        material: new Cesium.ImageMaterialProperty({
            //颜色控制 下面这个base64是红环
            image:'data:image/png;base64,',
            repeat:new Cesium.Cartesian2(1.0, 1.0),
            transparent:true,
            color:new Cesium.CallbackProperty(color,false)
        }),
        outlineColor: Cesium.Color.RED
    }
});

//精准定位
viewer.scene.camera.setView({
    destination: Cesium.Cartesian3.fromDegrees(121,29.56610,500),
    orientation: {
        heading: 1.555585,
        pitch: -0.464817,
        roll: 0.000000
    }
});
